  ["careener"] = "<html><body><h1>careener</h1><p>careener<p></p>n.<p></p>careen的变形<p></p>careen<p></p>[kə'ri:n]<p></p>vt.<p></p>【造船】(为修船)使船倾斜：<p></p>They careened the fishing boat to repaint the hull.<p></p>他们将渔船倾斜过来重新油漆船体。<p></p>使倾斜，使歪歪斜斜：<p></p>The muddy road careened the truck.<p></p>卡车行驶在泥泞的路上歪斜不稳。<p></p>vi.<p></p>倾斜；(船)侧倾(如在行驶中遇强风的船)：<p></p>Their ship was put into port to careen and refit.<p></p>他们的轮船被送入港口倾侧待修。<p></p>(车等)东倒西歪地疾驶：<p></p>The truck careened around the corner.<p></p>卡车东倒西歪地驶过街角。<p></p>n.<p></p>【造船】(船的)倾侧<p></p>倾斜，歪斜</p></body></html>",
