  ["chokeable"] = "<html><body><h1>chokeable</h1><p>chokeable<p></p>adj.<p></p>choke的变形<p></p>choke<p></p>[tʃəuk]<p></p>vt.<p></p>使窒息，使不能呼吸，掐住…的脖子；呛：<p></p>The smoke almost choked me.<p></p>烟呛得我几乎透不过气来。<p></p>阻塞；堵塞；阻止：<p></p>The pipe was choked by cotton.<p></p>管道被棉花堵住了。<p></p>扑灭；闷住；扼杀：<p></p>The great fire was choked at last.<p></p>大火终于被扑灭。<p></p>By reducing the financial allocations, the government was choking the life out of their schools.<p></p>政府正通过削减财政拨款的办法来扼杀他们的学校。<p></p>抑制，压制 (感情等)；阻止…的生长，妨碍…的发展 (常与 off连用)：<p></p>Her voice was choked with sobs.<p></p>她泣不成声。<p></p>咽下，吞下 (常与down 连用)：<p></p>He choked down his breakfast and rushed to the hospital.<p></p>他匆匆吞下早饭，急忙赶往医院。<p></p>使生气；使失望：<p></p>They were choked at his words.<p></p>他的话使他们很恼火。<p></p>[美国英语](打棒球、高尔夫球时)手握球棒中段击球<p></p>vi.<p></p>窒息；闷死；噎住；呛：<p></p>He choked on a soya bean and died suddenly.<p></p>他被一颗黄豆噎住，突然死去。<p></p>阻塞；塞满；阻止：<p></p>The channel had chocked up with sand so that boats couldn't use it.<p></p>航道被沙土淤积堵塞，因此船舶不能使用它了。<p></p>[口语](由于感情冲动或过分紧张而)说不出话来；哽咽：<p></p>He was choking with emotion.<p></p>他激动得说不出话来。<p></p>失去镇静；惊慌失措；(因过分紧张而)失常，搞糟；举止失措；变得慌乱；乱了步骤：<p></p>Our basketball team began to choke up in the last quarter.<p></p>我们的篮球队在最后一节因过度紧张而开始失常了。<p></p>n.<p></p>窒息；噎；呛<p></p>阻塞的声音<p></p>【机械学】 阻气门<p></p>【电工学】 扼流线圈，抗流圈<p></p>变形：<p></p>vt.<p></p>choked<p></p>. choking</p></body></html>",
