  ["construer"] = "<html><body><h1>construer</h1><p>[网络] 解释器</p></body></html>",
  ["construers"] = "<html><body><h1>construers</h1><p>construer<p></p>n.<p></p>construe的变形<p></p>construe<p></p>[kən'stru:; 'kɔnstru:]<p></p>vt.<p></p>解释，说明；给…作注解：<p></p>Different lawyers may construe the same law differently.<p></p>对同一法律，不同的律师可以做出不同的解释。<p></p>推断，推论；把…理解为，认为：<p></p>His withdrawal can only be construed as a protest.<p></p>他的退场只能被理解为是一种抗议。<p></p>口头翻译，对…作逐字直译：<p></p>to construe good Chinese into bad English<p></p>把优美的中文直译成拙劣的英语<p></p>分析(句子结构)：<p></p>He knows his Latin grammar indifferently, and cannot construe easily.<p></p>他的拉丁语法水平不高，所以无法得心应手地分析句子。<p></p>【语法学】(按句法规则)使(词、短语等)连用：<p></p>The verb “insist” is often construed with “on” or “upon”.<p></p>动词 insist 经常与on或upon连用。<p></p>vi.<p></p>作语法关系分析；作语法解释<p></p>n.<p></p>解释；推断，直译<p></p>近义词:<p></p>explain<p></p>变形：<p></p>vt.<p></p>construed<p></p>. construing</p></body></html>",
  ["construes"] = "<html><body><h1>construes</h1><p>v make sense of; assign a meaning to</p><p>v. 解释（陈述、行为等）( construe的第三人称单数 ); 翻译, 作句法分析</p></body></html>",
