  ["contesters"] = "<html><body><h1>contesters</h1><p>contester<p></p>n.<p></p>contest的变形<p></p>contest<p></p>['kɔntest; kən'test]<p></p>n.<p></p>斗争；竞争，争夺<p></p>比赛，竞赛<p></p>争论，争辩；论战<p></p>vt.<p></p>争夺；争取；与…竞争：<p></p>The seat was being hotly contested among the politicians.<p></p>政客们正在激烈地争夺那个席位。<p></p>争论，争辩：<p></p>The lawyer contested every point.<p></p>律师逐点进行争辩。<p></p>对…提出质疑：<p></p>They contested his right to speak.<p></p>他们对他的发言权提出了质疑。<p></p>vi.<p></p>争论，争辩；争夺；竞争：<p></p>争论，争辩；争夺；竞争：<p></p>They contested against the world's best runners in the games.<p></p>在运动会上他们与世界最优秀的赛跑选手竞争。<p></p>近义词:<p></p>conflict<p></p>短语:<p></p>close contest<p></p>势均力敌的竞争(指竞选等)</p></body></html>",
