  ["continual"] = "<html><body><h1>continual</h1><p>a. occurring without interruption; chiefly restricted to what recurs regularly or frequently in a prolonged and closely spaced series<p></p>s. `continual' (meaning seemingly uninterrupted) is often used interchangeably with `continuous' (meaning without interruption)</p><p>a. 持续不断的, 继续的<p></p>[建] 连续的</p></body></html>",
