  ["continuation"] = "<html><body><h1>continuation</h1><p>n the act of continuing an activity without interruption<p></p>n a part added to a book or play that continues and extends it<p></p>n a Gestalt principle of organization holding that there is an innate tendency to perceive a line as continuing its established direction<p></p>n the consequence of being lengthened in duration</p><p>n. 继续, 续集, 补编<p></p>[医] 连续</p></body></html>",
