  ["continued"] = "<html><body><h1>continued</h1><p>a. without stop or interruption</p><p>a. 继续的, 延续的<p></p>[医] 连续的</p></body></html>",
  ["continuer"] = "<html><body><h1>continuer</h1><p>[网络] 产品测试通过率计算的调用</p></body></html>",
  ["continuers"] = "<html><body><h1>continuers</h1><p>continuer<p></p>n.<p></p>continue的变形<p></p>continue<p></p>[kən'tinju:]<p></p>vi.<p></p>继续，延续，延伸：<p></p>After a short break the play continued.<p></p>经过短暂的休息以后，戏继续上演。<p></p>持续：<p></p>The strike continued for several days.<p></p>罢工持续了几天之久。<p></p>逗留，停留：<p></p>They continued in Shanghai when she went to Hangzhou.<p></p>她去杭州时他们留在上海。<p></p>维持原状，保持：<p></p>He continued silent.<p></p>他保持沉默。<p></p>vt.<p></p>使继续；坚持：<p></p>He continued the work day after day.<p></p>他一天一天地继续做这件工作。<p></p>使延伸，延长；扩展：<p></p>He continued his fence from the garden to the gate.<p></p>他把篱笆从花园扩展到大门口。<p></p>使持续，使持久；保持；保留：<p></p>If their present policy is continued, I am afraid that war is inevitable.<p></p>如果他们目前的政策持续不变的话，恐怕战争就不可避免了。<p></p>继续说，接着说:<p></p>He continued that he never thought that the chief engineer himself would come.<p></p>他接着说他从来没想到总工程师会亲自来。<p></p>[美国英语]【法律】延期，推延(诉讼)<p></p>近义词:<p></p>last<p></p>. endure<p></p>. abide<p></p>. persist<p></p>反义词:<p></p>stop<p></p>. cease<p></p>变形：<p></p>vi.<p></p>continued<p></p>. continuing</p></body></html>",
