  ["control"] = "<html><body><h1>control</h1><p>n. power to direct or determine<p></p>n. a relation of constraint of one entity (thing or person or group) by another<p></p>n. (physiology) regulation or maintenance of a function or action or reflex etc<p></p>n. the activity of managing or exerting control over something</p><p>n. 控制, 管理, 克制, 控制器, 操纵装置<p></p>vt. 控制, 操纵, 抑制<p></p>[计] 控制; 控制器</p></body></html>",
