  ["controls"] = "<html><body><h1>controls</h1><p>n power to direct or determine<p></p>n a relation of constraint of one entity (thing or person or group) by another<p></p>n (physiology) regulation or maintenance of a function or action or reflex etc<p></p>n a standard against which other conditions can be compared in a scientific experiment<p></p>n the activity of managing or exerting control over something<p></p>n the state that exists when one person or group has power over another<p></p>n discipline in personal and social activities<p></p>n great skillfulness and knowledge of some subject or activity<p></p>n a mechanism that controls the operation of a machine<p></p>n a spiritual agency that is assumed to assist the medium during a seance<p></p>n the economic policy of controlling or limiting or curbing prices or wages etc.<p></p>v exercise authoritative control or power over<p></p>v lessen the intensity of; temper; hold in restraint; hold or keep within limits<p></p>v handle and cause to function<p></p>v control (others or oneself) or influence skillfully, usually to one's advantage<p></p>v check or regulate (a scientific experiment) by conducting a parallel experiment or comparing with another standard<p></p>v verify by using a duplicate register for comparison<p></p>v be careful or certain to do something; make certain of something<p></p>v have a firm understanding or knowledge of; be on top of</p><p>n. 控制；控制元件；控制装置（control的复数）</p></body></html>",
